return items.map(item => {
  const buffer = Buffer.from(item.json.base64, 'base64');

  item.binary = {
    data: {
      data: buffer.toString('base64'),
      mimeType: 'image/jpeg',
      fileName: 'imagem.jpg'
    }
  };

  return item;
});

return items.map(item => {
  const img = item.json.image || item.json.body?.image;

  if (!img || typeof img !== 'string') {
    return { json: { error: "Campo 'image' está ausente ou mal formatado." } };
  }

  const parts = img.split(',');
  const base64 = parts.length > 1 ? parts[1] : parts[0];

  return {
    json: {
      base64
    }
  };
});
